caption:
b'Over the past 40 years, Shenzhen has created many miracles. It has developed from a small fishing village to an international and innovative city that is full of charm, energy, vitality and innovation.:bridge_at_night:
Today, let us travel through time and space and appreciate the urban height of Shenzhen in the past 40 years:
:sparkles: In the 1980s, constructed by CSCEC, the 160-meter International World Tower was called "China's tallest building", and representing the Shenzhen construction speed of 1floor/3days;
:sparkles: In the 1990s, Diwang Building was upgraded to the tallest building in Asia at the time with a height of 383.95 meters. Through this project, CSCECers updated Shenzhen construction speed to 1 floor/2.5 days;
:sparkles: In 2012, with the efforts of CSCEC\xe2\x80\x99s team, the newly completed Jingji 100 Building made Shenzhen grow to 441.8 meters;
:sparkles: In 2016, we continued to achieve breakthroughs. The completed Ping\xe2\x80\x99 an Financial Center pushed Shenzhen to a 592.5-meter-high cloud.
Behind the rising "Shenzhen Skyline" is the new height of Shenzhen's economic and social development recorded by CSCEC. Not only in Shenzhen, CSCEC will continue to act as a participant and supporter of more urban development and construction, and provide high-quality construction services.:man_construction_worker_selector:'
